import React, { useState } from "react";

import Quiz from "./Quiz";

function App() {
  const [started, markStarted] = useState(false);

  return started ? (
    <Quiz></Quiz>
  ) : (
    <div>
      <h4>THE ULTIMATE</h4>
      <h1>TAYLOR SWIFT BRIDGE</h1>
      <h3>LYRICSQUIZ</h3>
    </div>
  );
}

export default App;
